import TextEditor from './components/TextEditor'
import {
  BrowserRouter,
  Routes,
  Navigate,
  Route
} from 'react-router-dom';
import {v4 as uniqueId} from 'uuid';

function App() {
  return (
    <BrowserRouter>
    <Routes/>
        <Route path="/" exact>
          <Navigate to={`/documents/${uniqueId()}`}/>
        </Route>
        <Route path="/documents/:id" exact>
          <Navigate to={<TextEditor/>} />
        </Route>
      <Routes/>
    </BrowserRouter>
  );
}

export default App;
